import { INCREMENT } from "./action-types";

const initialState = {
  pokemons: [],
  isError: false,
  isLoading: false,
};

export default function numberBasicReducer(
  state = initialState,
  { type, payload }
) {
  switch (action.type) {
    case INCREMENT:
      return state + 1;
    default:
      return state;
  }
}
